import React, { Component } from 'react';
import './Exportar.css';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import axios from 'axios';
import { URL_DEFAULT } from '../../../urls/urls';

const token = window.localStorage.getItem('token');

class Exportar extends Component {

    send = () => {
        axios.get(URL_DEFAULT + 'store_report')
        .then(function(res){
            if(res.status == 200){
                axios.post(URL_DEFAULT + 'contactar')
                .then(function(res){
                    if(res.status === 200){
                        alert('Se envío un correo al usuario');
                    }
                })
            }
        });
    }
    render() {

        return (

            <div id="index-modulos" className="row">
                <div className="col l12">
                    <div className="card-panel">
                        <div className="card-content">
                            <a href = {URL_DEFAULT + '/exportar'}>Exportar</a>
                            <a href='#' onClick={this.send}>  Enviar reporte</a>
                        </div>
                    </div>
                </div>

            </div>


        );
    }
}

export default Exportar;
